@Override
public boolean seekExact(BytesRef text, boolean useCache) throws IOException {
  if (super.seekExact(text, useCache)) {
    state = State.POSITIONED;
    return true;
  } else {
    state = State.UNPOSITIONED;
    return false;
  }
}

